import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter ,Link,Router,  Routes,  Route,Switch } from "react-router-dom";
import Candels from './Candels'
import  Search1  from "./Search1";
import  Search  from "./Search";
function FetchSearch()
{
    {  
        var srch=""
        function fetch(e)
        {
          srch=e.target.value 
        }
        
        
    }
   
        return(<>
        <input type="text" onChange={fetch}/>
        <a href="/search"> <button>Generate</button></a>
        <h1>{srch}</h1>

        <BrowserRouter>
<Link to="/inn">search</Link>
      <Routes>
          <Route path="inn" element={<Search/>} />
          <Route path="candels" element={<Candels />} />
      </Routes>
    </BrowserRouter>
  

       </>)
       
    }
    export default FetchSearch
